import React from "react";

const InfoCard = ({item,iconClass,titleClass,infoClass}) => {

    return(
        <div>
            <div className={iconClass}>
                <i className={item.icon}></i>
            </div>
            <div className={titleClass}>
                <h2>{item.title}</h2>
            </div>
            <div className={infoClass}>
                <p>{item.info}</p>
            </div>
        </div>
    );
}

export default InfoCard;
